De vooruitzichten voor de gescheiden en ontmoedigde Amy Minsky zijn niet best wanneer ze zich gedwongen ziet om weer bij haar ouders in te trekken op 35-jarige leeftijd. Iedereen probeert te helpen maar net wanneer ze haar geduld begint te verliezen, verschijnt er een stoutmoedige tiener in haar leven die haar laatste beetje gevoel van eigenwaarde aanwakkert...



